import {browserHistory} from 'react-router'
var bbid = '';

class Auth {

    setUser(id){
        bbid = id;
    }

    getBbid(){
        console.log(bbid)
        if(bbid !== ''){
            return bbid;
        }else{
            browserHistory.push('/home');
        }
    }

    logout(){
        bbid = '';
        browserHistory.push('/home')
    }
}

export default Auth;
